document.addEventListener('DOMContentLoaded', function() {
/* Add Code Here */
    document.getElementById("addBtn").addEventListener("click", (event) => {
        let target = document.getElementById("todoList");
        let element = document.createElement('div')
        let itemContent = document.createElement('div')
        itemContent.classList.add("itemContent");
        itemContent.innerHTML = document.getElementById("input").value;
        let deleteBtn = document.createElement('button');
        deleteBtn.innerHTML = "Delete";
        deleteBtn.classList.add("deleteBtn");
        element.classList.add("todoItem");
        element.appendChild(itemContent);
        element.appendChild(deleteBtn);
        target.appendChild(element);

        deleteBtn.addEventListener("click", (event) => {
            let target = event.target.closest(".todoItem")
            target.remove();
        })
    });

    
});

